import React from "react";
import styled from "styled-components";
//import {tablet} from '../Responsive'

const Alert = () => {
	const Div = styled.div`
	margin: 0;
	padding:0;
	`

	return (
	  <Div className='alert alert-danger'>Alert goes here</Div>
	)
}

export default Alert
